script: |
  super -f text -I q3690.spq | sort > q3690.out

inputs:
  - name: q3690.spq
    data: |
      SELECT DISTINCT + col1 + + col1 * col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + col0 * + cor0.col2 + + col0 AND col1 OR NOT ( col0 * col1 + col1 ) BETWEEN - cor0.col0 AND + col1;
  - name: tab1

outputs:
  - name: q3690.out
    data: |
      104
      1053
      650
